    false,nt"url": null,nt"notes": "This narrative report for Tule Lake National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1959.
    The report begins by summarizing the weather conditions, habitat conditions, water
    conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
    fish, reptiles, and disease- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, and collections and receipts.
    A progress report on field investigations and applied research is included. The
    public relations section of the report describes recreational uses, Refuge visitors,
    and Refuge participation. Items of interest, N-R forms, photographs, newspaper articles,
    and narrative reports on Clear Lake National Wildlife Refuge, Upper Klamath National
    Wildlife Refuge, and Lower Klamath National Wildlife Refuge are attached.",nt"license_title":
